    const submitHandler = (event) => {
        event.preventDefault();
    }

    const onCancelClick = (event) => {
        props.onCancelClick('heee' , event.target.value);
    }

    return (
        <form onSubmit={submitHandler}>
            <button>Save</button>
            <button onClick={(event) => onCancelClick(event)}>Cancel</button>
        </form>
    )

}
